    //   width: 500
    // }
    return (
      <div>
        {/* <PageHeader title="Assets" actions={[]} /> */}
        {AssetTypeAnalytics}

      </div>
    );
  }
}

Analytics.propTypes = {
  AssetTypeCount: PropTypes.object.isRequired
};

Analytics.defaultProps = {};
const mapStateToProps = (state, props) => {
  const { page } = props;
  const formateFunction = pageConfig[page].formateFunc;
  return {
    AssetTypeCount: formateFunction.assetTypeCount(state.analyticsReducerStore[STORE.ASSETS_COUNT_WRT_ASSET_TYPE]),
    inProgress: state.listReducerStore.inProgress
  };
};

const mapDispatchToProps = dispatch => {
  return {
    makeCall: (type, data) => {
      dispatch(getActionsFormate(type, data));
    },
    resetState: type => {
      dispatch(getActionsFormate(type));
    }
  };
};

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(Analytics)
);
